import React from 'react'
import Buy from './Buy'
import { Link } from "react-router-dom";

const Instant = () => {
  return (
    <div className=''>
      <button className="buy-btn1">
        <Link to="/Buy"> Buy</Link>
      </button>
      <button className="buy-btn1">
        <Link to="/Sell"> Sell</Link>
      </button>
    </div>
  )
}

export default Instant
